const AdTeamMember= (props) => {

  return (
    <div>
        <input type="text" className='nomParticipant'/>
        <input type="checkbox" className='capitaine' name='capitaine'></input>
        <label>est-il capitaine?</label>
        <button className="boutonAjouter" onClick={props.ajouter}>ajouter</button>

    </div>
  );
}

export default AdTeamMember;
